priceInputHandler=(e)=>{
    // console.log(e.target.value)
    let checknumber=e.target.value
    if(isNaN(checknumber)){
        return null
    }else{
    this.setState({price:e.target.value,pricecheck:false})
    }
}


pricevalidate=(e)=>{
    if(e.target.value <500){
        this.setState({pricecheck:true})
    }else{
        this.setState({pricecheck:false})
    }
}


